import React from 'react';
import Login from './pages/login';
import './App.css'
import { BrowserRouter as Router,Route,Routes } from 'react-router-dom';


function App() {
  return (
    <Router>
      <Route exact path='/' component={Login}></Route>
    </Router>
  );
}

export default App;
